import CartItem from "./CartItem";

import React, { Component } from 'react'

export default class CartList extends Component {
	render() {
		  const product = this.value.cart;

		return (
      <div className="container d-none d-md-block">
        <div className="row">
          {product.map(item => (
            <CartItem item={item} />
          ))}
        </div>
      </div>
    );
	}
}
